import React from "react";


class App extends React.Component {
  state = {
    temp: null,
    availableList: [],
    wishList: []
  }

  render() {
    return (
      <div>
        <h1>My Wish List</h1>
        <h3>Available Items</h3>
        <input type="text" />
        <button>Add to Available</button>
      </div>
    )
  }
}

export default App
